import React from 'react';
import './Auth.css';
// Import Font Awesome (if not already done globally)
import 'font-awesome/css/font-awesome.min.css'; 

const Profile = () => {
    return (
        <div className="main_menu_wrapper">
            <div className="form-container">
                <form action="/action_page.php">
                    <h2>Register Form</h2>
                    
                    <div className="input-container">
                        <i className="fa fa-user icon"></i> {/* Updated className */}
                        <input className="input-field" type="text" placeholder="Username" name="usrnm" />
                    </div>

                    <div className="input-container">
                        <i className="fa fa-envelope icon"></i> {/* Updated className */}
                        <input className="input-field" type="text" placeholder="Email" name="email" />
                    </div>
                    
                    <div className="input-container">
                        <i className="fa fa-key icon"></i> {/* Updated className */}
                        <input className="input-field" type="password" placeholder="Password" name="psw" />
                    </div>

                    <button type="submit" className="btn">Register</button> {/* Updated className */}
                </form>
            </div>
        </div>
    );
};

export default Profile;
